# 3.4.2 MRI Protocol and post-processing 

Patients underwent 3T MRI (Site 1: Skyra, Siemens Healthcare, Site 2: Prisma, Siemens Healthcare) respiratory gated 2D coronal spoiled gradient EPI DWI with denoising and motion correction and 9 b-values (b-values: $0,10,30,50,80,120,200,400,800 \mathrm{~mm} 2 / \mathrm{s}$; TR/TE $=$ 1500/58ms, voxel size $=2 \times 2 \times 5 \mathrm{~mm} 3,4$-directions, 16 -slices, 5 mm -spacing, 3 -averages). Cortical ROIs were drawn by Observer 1 (an abdominal radiologist with 14 years of experience), and spectral diffusion run on a voxel-wise basis. Spectral diffusion was run with $\lambda_{C V}, \lambda_{0.1}$, and $\lambda_{B}$ for; one-to-one agreement between flow from the three methods was calculated via Lin's concordance correlation coefficient (CCC). Spectral peaks were sorted into (1) vascular, (2) tubular, and (3) tissue parenchyma diffusion and the largest peak closest to $1.810^{-3} \mathrm{~mm}^{2} / \mathrm{s}$, a literature value between two-compartment and three-compartment rigid fits ${ }^{15}$, was considered the tissue parenchyma peak. Beyond that, peaks were sorted as $0.8<$ tissue $<5 \leq$ tubule $<50 \leq$ vascular for diffusion coefficients in units of $10^{-3} \mathrm{~mm}^{2} / \mathrm{s}^{8,9,15,16}$. Using Eq. 5 with $f_{w}=0.80$ and an average kidney as 120 g with a density of $1 \rho=1 \mathrm{~g} / \mathrm{mL}^{40-42}$ quantitative flow was calculated as

$$
\begin{aligned}
\text { Flow }[m l / \min / \text { kidney }]=f D & \times \frac{2(0.80)}{\left(0.32^{2}\right)} \times 100 \times 60[m L / 100 \mathrm{~g} / \mathrm{min}] \times 120 \mathrm{~g} / \text { kidney } \\
& =f D \times 112,500 \mathrm{ml} / \mathrm{min}
\end{aligned}
$$

Vascular and tubular flow using Eq. 8 was reported for the healthy volunteers and four diagnostic groups according to their kidney function and fibrosis (IFTA>0): (1) "stable allografts" - normal/stable function and no fibrosis, (2) impaired function and no fibrosis, (3) normal/stable function and fibrosis, (4) impaired function and fibrosis.
